// Solution 1:
const moveElementToEnd = (arr, toMove) => {
    let left = 0;
    let right = arr.length - 1;

    while(left < right){
        if(arr[right] === toMove && arr[left]!== toMove){
            [arr[left], arr[right]] = [arr[right], arr[left]];
            left++;
            right--;
        } else if(arr[right]!== toMove){
            right--;
        } else{
            right--;
        }
    }

    return arr;
}

console.log(moveElementToEnd(['a', 'c', 'c', 'c', 'c', 'c', 'a', 'a', 'a', 'a'], 'c')); // ['a', 'a', 'c', 'c', 'c', 'c', 'c', 'a', 'a', 'a']
console.log(moveElementToEnd(['e', 'e', 'e', 'e', 'e', 'e', 'a', 'a', 'a', 'a'], 'e')); // ['a', 'e', 'e', 'e', 'e', 'e', 'e', 'a', 'a', 'a']
console.log(moveElementToEnd(['i', 'i', 'i', 'i', 'a', 'a', 'a', 'a', 'a', 'a'], 'i')); // ['a', 'i', 'i', 'i', 'i', 'a', 'a', 'a', 'a', 'a']
